import { SHOW_TASKLIST } from './actions'
import {loadDashboard} from './actions'

function taskListReduser(state = {},action){
    switch(action.type){
        case SHOW_TASKLIST:
            return action.payload
        default:
            return state
    }
}
console.log(taskListReduser,loadDashboard())
export default taskListReduser
